import React, { Component } from 'react';
import Connector from '../images/connector.png';

class Resume extends Component {
  render() {
    return (
      <div>
        <h1>Resume Page</h1>
        <a style={{ color: 'white' }} href={Connector} download='connector.png'>
          Download
        </a>
      </div>
    );
  }
}

export default Resume;
